/* ================================
   GENERATE CERTIFICATE PDF
================================ */
const generatePDF = (name) => {
  return new Promise((resolve, reject) => {
    try {
      const doc = new PDFDocument({
        size: [842, 595], // A4 Landscape exact
        margin: 0,
        autoFirstPage: false, //  NO blank page
      });

      const buffers = [];
      doc.on("data", buffers.push.bind(buffers));
      doc.on("end", () => resolve(Buffer.concat(buffers)));

      doc.addPage({ size: [842, 595] });

      SVGtoPDF(doc, certificateSVG(name), 0, 0, {
        assumePt: true,
      });

      doc.end();
    } catch (err) {
      reject(err);
    }
  });
};

/* ================================
   SEND CERTIFICATE EMAIL
================================ */
const sendCertificates = async () => {
  const users = await User.find({
    role: "PARTICIPANT",
    is_active: true,
    email: { $exists: true, $ne: "" }
  });

  console.log(` Total Participants: ${users.length}`);

  for (const user of users) {
    try {
      const pdf = await generatePDF(user.name);

      await transporter.sendMail({
        from: `"Hack & Make 2026" <${process.env.EMAIL_USER}>`,
        to: user.email,
        subject: "Your Participation Certificate  Hack & Make 2026",
        text: emailText(user.name),
        attachments: [
          {
            filename: "Hack_Make_2026_Certificate.pdf",
            content: pdf,
          },
        ],
      });

      console.log(` Certificate sent to ${user.name} (${user.email})`);
    } catch (error) {
      console.error(` Failed for ${user.email}`, error.message);
    }
  }

  console.log(" ALL PARTICIPANT CERTIFICATES SENT");
};

